DROP TABLE IF EXISTS `CharSections`; 
CREATE TABLE `CharSections` ( `ID` INT NOT NULL DEFAULT '0', `RaceID` INT NOT NULL DEFAULT '0', `SexID` INT NOT NULL DEFAULT '0', `BaseSection` INT NOT NULL DEFAULT '0', `TextureName_1` TEXT NULL, `TextureName_2` TEXT NULL, `TextureName_3` TEXT NULL, `Flags` INT NOT NULL DEFAULT '0', `VariationIndex` INT NOT NULL DEFAULT '0', `ColorIndex` INT NOT NULL DEFAULT '0', PRIMARY KEY (`ID`)) ENGINE=InnoDB DEFAULT CHARSET=utf8; 
